import React from 'react';

const UserContributions = ({ contributions }) => {
  return (
    <div>
      <h2>User Contributions</h2>
      <ul>
        {contributions.map((contribution) => (
          <li key={contribution.id}>{contribution.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default UserContributions;
